INSERT INTO `api_requests` VALUES (12,'2020-07-28 16:50:31','http://sf.bulan-baru.com:8002/api','sources','GET','[{\"id\":\"2\",\"source\":\"BMKG\",\"api_key\":\"\",\"api_secret\":null,\"base_url\":\"https:\\/\\/peta-maritim.bmkg.go.id\\/api\\/point_req\",\"default_endpoint\":null,\"default_querystring\":null,\"default_payload\":\"{\\\"model\\\":\\\"{BMKG_MODEL}\\\",\\\"modelrun\\\":\\\"{BMKG_DATETIME}\\\",\\\"lon\\\":\\\"{LONGITUDE}\\\",\\\"lat\\\":\\\"{LATITUDE}\\\",\\\"var\\\":[{BMKG_MODEL_VARS}]}\",\"parser\":\"BMKGParser2\",\"description\":null,\"active\":\"1\"},{\"id\":\"4\",\"source\":\"WorldTides\",\"api_key\":\"5575acb9-8577-4438-a1d7-4cb2c1b546af\",\"api_secret\":null,\"base_url\":\"http:\\/\\/www.worldtides.info\\/api\",\"default_endpoint\":null,\"default_querystring\":\"datum=LAT&length=604800&heights&extremes&lat={LATITUDE}&lon={LONGITUDE}&key={API_KEY}\",\"default_payload\":null,\"parser\":null,\"description\":null,\"active\":\"1\"},{\"id\":\"5\",\"source\":\"Magicseaweed API\",\"api_key\":\"a3db6b0d1f60534b86ba9a422a0f658a\",\"api_secret\":null,\"base_url\":\"http:\\/\\/magicseaweed.com\\/api\",\"default_endpoint\":\"{API_KEY}\\/forecast\\/\",\"default_querystring\":\"spot_id=\",\"default_payload\":null,\"parser\":null,\"description\":null,\"active\":\"1\"}]',NULL,'2020-07-29 07:17:00',NULL),(13,'2020-07-28 16:50:31','http://sf.bulan-baru.com:8002/api','locations','GET','[{\"id\":\"30\",\"location\":\"Kuta Reef\",\"latitude\":\"-8.735776\",\"longitude\":\"115.151377\",\"max_tidal_variation\":\"3.056\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":null,\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":2.17},{\"id\":\"29\",\"location\":\"Padma Beach\",\"latitude\":\"-8.707832\",\"longitude\":\"115.156428\",\"max_tidal_variation\":\"3.056\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":null,\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":3.07},{\"id\":\"11\",\"location\":\"Yo-Yos\",\"latitude\":\"-8.976352\",\"longitude\":\"116.729056\",\"max_tidal_variation\":\"3.195\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"There are two breaks here, both right-handers  The main one is offers some weighty barrels and long carvable walls.  The other is known as the wedge and tends to be less crowded and although the ride is shorter, often more fun with a less gruelling paddle out.\\n\\nThis bay faces directly in to the swell and is therefore the main swell-magnet of the region.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":173.36},{\"id\":\"36\",\"location\":\"Donuts\",\"latitude\":\"-8.919696\",\"longitude\":\"116.739805\",\"max_tidal_variation\":null,\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":\"10\",\"description\":null,\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":173.67},{\"id\":\"10\",\"location\":\"Super Sucks\",\"latitude\":\"-8.930356\",\"longitude\":\"116.739698\",\"max_tidal_variation\":\"3.195\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"The name pretty much says it all, especially on low tide when it\'s more for bodyboarders than standups.  When on it offers some incredible barrels. Can be crowded.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":173.8},{\"id\":\"9\",\"location\":\"Scar Reef\",\"latitude\":\"-8.854245\",\"longitude\":\"116.756482\",\"max_tidal_variation\":\"3.147\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"Long left-hander with barrelling sections.  Scar reef can hold up to well over double-overhead.  When small and tide not too low it can appear a friendly wave, low tide and with size is a different matter.  Reef is sharp as you can imagine given the name.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":174.78},{\"id\":\"35\",\"location\":\"Dirty Hippies\",\"latitude\":\"-8.676327\",\"longitude\":\"116.7693355\",\"max_tidal_variation\":\"2.857\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":null,\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":175.81},{\"id\":\"39\",\"location\":\"Spot X\",\"latitude\":\"-8.857162\",\"longitude\":\"118.087043\",\"max_tidal_variation\":null,\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":\"38\",\"description\":\"Long left hander offering a barrel section near take-off.  End section often being a wave in itself, punch wall.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":320.76},{\"id\":\"38\",\"location\":\"Nungas\",\"latitude\":\"-8.793584\",\"longitude\":\"118.374689\",\"max_tidal_variation\":\"3.392\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"Nungas can peel off like a mini version of G-land, grooming 200m long lefts with alternating shack and whack sections to play with. Many surfers get diverted on the long walk to Periscopes, opting for long ride, short walk. Nungas bends into a big calm bay, needing more size than the Peak and not too much S in the afternoon trades.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":352.16},{\"id\":\"37\",\"location\":\"Lakey Peak\",\"latitude\":\"-8.805071\",\"longitude\":\"118.376009\",\"max_tidal_variation\":\"3.392\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"Perfect Lakey Peak peels off short, 30-40m lefts and rights into channels either side. The right will often throw up backdoor tube rides but gets too shallow at low tide, when the left is churning out predictable, ideal speed barrel rides. Mid tide lip-smacking sessions will appeal to intermediates and the flattish reef is user-friendly, except during full or new moon phases. Getting out to the Peak is easy with only a short 450m paddle or take the zodiac for around $2 return. Lakey Peak can hold juicy sized waves, but the optimum time to hit it is when it\'s in that perfect headhigh plus range.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":352.33},{\"id\":\"7\",\"location\":\"Peros\",\"latitude\":\"-9.609278\",\"longitude\":\"118.984122\",\"max_tidal_variation\":\"3.402\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"Pero Lefts can be excellent as swell is refracted heavily into big bowl sections with ample tube-time.\\n\\nPeros right is less consistent and the shape is not as good.  Sometimes preferable given wind and swell directions.\\n\\nThe reef here is sharp and there can be travelling surfers in the lineup as there is a homestay in the village.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":429.82},{\"id\":\"8\",\"location\":\"Wainjapu\",\"latitude\":\"-9.632122\",\"longitude\":\"119.003612\",\"max_tidal_variation\":null,\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":\"7\",\"description\":\"Situated right in front of a traditional Sumba village this is a fun left hander that can produce big walls.  Works best at mid until high tide.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":432.47},{\"id\":\"19\",\"location\":\"El Chongy\",\"latitude\":\"-9.746718\",\"longitude\":\"119.177632\",\"max_tidal_variation\":null,\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":\"21\",\"description\":\"Another super-fun left hander comprising two sections.  The first is where the wave peaks and barrels can be had ... the second is the end of the reef that breaks in to a channel (which can at times throw up a nice little right-hander).\\n\\nAlmost always has swell here.  Best at mid tide and offers some shelter from SE winds.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":454},{\"id\":\"22\",\"location\":\"Pinnacles\",\"latitude\":\"-9.749645\",\"longitude\":\"119.278657\",\"max_tidal_variation\":null,\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":\"21\",\"description\":\"Punchy, fast right-hander frequently offering short barrels.  Excellent shaped wave that suffers at times from exposure to wind.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":464.82},{\"id\":\"21\",\"location\":\"Marosi\",\"latitude\":\"-9.752782\",\"longitude\":\"119.284829\",\"max_tidal_variation\":\"3.484\",\"timezone\":\"Asia\\/Makassar\",\"timezone_offset\":\"+0800\",\"active\":\"1\",\"forecast_location_id\":null,\"description\":\"Is a big, shifty, deepwater right with power and long hold-downs in chunky SW swells. The scenic bay is sensitive to wind plus there are some other peaks and an outside left, but in a small swell, there\\u2019s a fun, hazard-free beachbreak.\\n\\nThere is also Sumba Sunsets which is a big left-hander, catching most of the swell that enters the bay.  Frequently disturbed by the wind, the experience is more of raw ocean power than surfing clean Indo walls.\",\"swell_adjustment\":null,\"wind_adjustment\":null,\"rating_params\":null,\"last_feed_run_id\":\"999\",\"distance\":465.56}]',NULL,'2020-07-29 07:17:00',NULL),(14,'2020-07-28 17:35:32','http://sf.bulan-baru.com:8002/api','forecast-daylight/30','GET','{\"feed_run_id\":\"999\",\"location_id\":\"30\",\"weighting\":{\"5\":3,\"2\":1,\"4\":1},\"forecast_from\":\"2020-07-28 08:00:00 +0800\",\"forecast_to\":\"2020-08-07 00:00:00 +0800\",\"created\":\"2020-07-28 22:01:00 +0000\",\"hours\":{\"2020-07-28 08:00:00 +0800\":{\"swell_height\":{\"weighted_values\":2.53,\"weighted_sum\":1,\"weighted_average\":2.53,\"original_values\":{\"2\":\"2.53\"}},\"swell_height_primary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_height_secondary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_period\":{\"weighted_values\":15.29,\"weighted_sum\":1,\"weighted_average\":15.29,\"original_values\":{\"2\":\"15.29\"}},\"swell_period_primary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_period_secondary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_direction\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_direction_primary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"swell_direction_secondary\":{\"weighted_values\":0,\"weighted_sum\":0,\"weighted_average\":null,\"original_values\":[]},\"wind_speed\":{\"weighted_values\":20.18,\"weighted_sum\":1,\"weighted_average\":20.18,\"original_values\":{\"2\":\"20.18\"}