INSERT INTO `sf_locations` VALUES (1,'Millers',-9.979644,119.941755,3.519,'Asia/Makassar','+0800',1,NULL,'Very long, forgiving right-hander that can often barrel on take off.  Best surfed at low tide, early morning because of winds.  Late arvo sessions are sometimes possible and even with less than perfect conditions time spent in this beautiful bay is time well spent..\n\nYep, dat\'s right shun.',NULL,NULL,'{\n\"swell\": {\"optimal_direction\": 45, \"period_ceiling\": 15, \"height_ceiling\": 2.25},\n\"wind\": {\"optimal_direction\": 200, \"speed_floor\": 8, \"speed_max\": 50}\n}'),(2,'Drifters',-9.753322,119.449775,3.499,'Asia/Makassar','+0800',1,NULL,'Right-hander that runs along a peninsula lined with palm trees.  It\'s faster and more interesting than Millers, with varying sections that sometimes link up.  Barrels are not uncommon here, lots of opportunity to smack the lip.',NULL,NULL,NULL),(3,'Mangkudu Lefts',-10.327205,120.100195,3.578,'Asia/Makassar','+0800',1,NULL,'Mangkudu is a swell magnet that can be firing when other places in Sumba are flat.  The reef produces multiple peaks, almost all left-handers with the end of the reef producing the most consistent wave.  Please further up the reef are larger and barrels can be found.',NULL,NULL,NULL),(4,'Five-Os',-10.248041,120.572895,3.582,'Asia/Makassar','+0800',1,NULL,NULL,NULL,NULL,NULL),(5,'Holograms',-9.95974,119.902024,NULL,'Asia/Makassar','+0800',1,1,'Super-fun, smackable left-hander often producing machine-like perfection.  Never gets too big because the larger swell breaks further out.  Situated in one of the most beautifu lbays we\'ve ever seen. Best on mid tide.','{\"height\": 0.6}',NULL,'{\n\"swell\": {\"optimal_direction\": 45, \"period_ceiling\": 15, \"height_ceiling\": 2.25},\n\"wind\": {\"optimal_direction\": 260, \"speed_floor\": 8, \"speed_max\": 50}\n}'),(6,'Sphinx',-9.939958,119.869237,NULL,'Asia/Makassar','+0800',1,1,'Iconic location that produces a left-hander with two main sections that sometimes link up.  The larger wave forms the firs section but it\'s the second section where the juice is.  Often  producing buttery conditions because of it\'s sheltered location, providing barrels, smackable lips and smooth faces are the norm. ','{\"height\": 0.8}',NULL,'{\n\"swell\": {\"optimal_direction\": 45, \"period_ceiling\": 15, \"height_ceiling\": 2.25},\n\"wind\": {\"optimal_direction\": 280, \"speed_floor\": 8, \"speed_max\": 50}\n}'),(7,'Peros',-9.609278,118.984122,3.402,'Asia/Makassar','+0800',1,NULL,'Pero Lefts can be excellent as swell is refracted heavily into big bowl sections with ample tube-time.\n\nPeros right is less consistent and the shape is not as good.  Sometimes preferable given wind and swell directions.\n\nThe reef here is sharp and there can be travelling surfers in the lineup as there is a homestay in the village.',NULL,NULL,NULL),(8,'Wainjapu',-9.632122,119.003612,NULL,'Asia/Makassar','+0800',1,7,'Situated right in front of a traditional Sumba village this is a fun left hander that can produce big walls.  Works best at mid until high tide.',NULL,NULL,NULL),(9,'Scar Reef',-8.854245,116.756482,3.147,'Asia/Makassar','+0800',1,NULL,'Long left-hander with barrelling sections.  Scar reef can hold up to well over double-overhead.  When small and tide not too low it can appear a friendly wave, low tide and with size is a different matter.  Reef is sharp as you can imagine given the name.',NULL,NULL,NULL),(10,'Super Sucks',-8.930356,116.739698,3.195,'Asia/Makassar','+0800',1,NULL,'The name pretty much says it all, especially on low tide when it\'s more for bodyboarders than standups.  When on it offers some incredible barrels. Can be crowded.',NULL,NULL,NULL),(11,'Yo-Yos',-8.976352,116.729056,3.195,'Asia/Makassar','+0800',1,NULL,'There are two breaks here, both right-handers  The main one is offers some weighty barrels and long carvable walls.  The other is known as the wedge and tends to be less crowded and although the ride is shorter, often more fun with a less gruelling paddle out.\n\nThis bay faces directly in to the swell and is therefore the main swell-magnet of the region.',NULL,NULL,NULL),(17,'Pulau Dana',-10.821972,121.267629,3.592,'Asia/Makassar','+0800',1,NULL,'Utterly remote, this island is steeped in local folklore ... the place resonates with wild natural energy.  Fishing can be amazing and providing the winds aren\'t too strong there\'s a surfable left-hander that breaks on to the island.  ',NULL,NULL,NULL),(18,'Raijua Wedge',-10.625107,121.521684,3.513,'Asia/Makassar','+0800',1,NULL,'Punchy, pitching left-hander that is well sheltered from SE winds.  Barrel straight from take off followed by a few big hacks are the norm here.',NULL,NULL,NULL),(19,'El Chongy',-9.746718,119.177632,NULL,'Asia/Makassar','+0800',1,21,'Another super-fun left hander comprising two sections.  The first is where the wave peaks and barrels can be had ... the second is the end of the reef that breaks in to a channel (which can at times throw up a nice little right-hander).\n\nAlmost always has swell here.  Best at mid tide and offers some shelter from SE winds.',NULL,NULL,NULL),(20,'Nihiwatu',-9.778807,119.371961,3.484,'Asia/Makassar','+0800',1,NULL,'The famous Occy\'s left... It\'s still an open question as to whether this wave can be surfed or not.\n\nIndonesian law prohibits private ownership of beach and sea so technically anyone can surf here... However, despite what the law says, local heavies will arrive with all sorts of threats if you actually try and surf... We generally avoid this place.',NULL,NULL,NULL),(21,'Marosi',-9.752782,119.284829,3.484,'Asia/Makassar','+0800',1,NULL,'Is a big, shifty, deepwater right with power and long hold-downs in chunky SW swells. The scenic bay is sensitive to wind plus there are some other peaks and an outside left, but in a small swell, theres a fun, hazard-free beachbreak.\n\nThere is also Sumba Sunsets which is a big left-hander, catching most of the swell that enters the bay.  Frequently disturbed by the wind, the experience is more of raw ocean power than surfing clean Indo walls.',NULL,NULL,NULL),(22,'Pinnacles',-9.749645,119.278657,NULL,'Asia/Makassar','+0800',1,21,'Punchy, fast right-hander frequently offering short barrels.  Excellent shaped wave that suffers at times from exposure to wind.',NULL,NULL,NULL),(23,'T-land',-10.886732,122.807052,3.518,'Asia/Makassar','+0800',1,NULL,'Famous, long, soft left-hander.  Can be really fun and relaxed when there\'s a good swell... Unfortunately the place is crowded with a large mix of travelling surfers and ex-pats.',NULL,NULL,NULL),(24,'Bodhis',-10.608227,121.891512,NULL,'Asia/Makassar','+0800',1,18,'Super long right-hander with many sections that sometimes can link up.  Fast.',NULL,NULL,NULL),(25,'Sawu Left',-10.504469,121.81499,3.487,'Asia/Makassar','+0800',1,NULL,'The wave hits a coral fringe near the main channel into the port town Seba, lining up some heavy walls with hollow sections if the swell is strong and W enough and the trades are offshore.',NULL,NULL,NULL),(26,'Sawu Right',-10.46157,121.83873,3.451,'Asia/Makassar','+0800',1,NULL,'Extremely fickle, occasionally firing off perfect right drainers down a swell-sheltered reef that often gets bumped up by SE trades. \n\nNeeds a massive swell to wrap around with as much W direction as possible to create some ruler-edged wonders and probably the best barrel in the east. ',NULL,NULL,NULL),(27,'Boa',-10.942038,122.840884,3.616,'Asia/Makassar','+0800',1,NULL,'Powerful right-hander offering barrels on take off and beautiful walls later down the line.  Excellent ruler-shaped wave that picks up a lot of swell.  Exposed to SE winds.',NULL,NULL,NULL),(28,'Sucky Mamas',-10.848968,122.815854,NULL,'Asia/Makassar','+0800',1,23,'Powerful right-hander a short distance north from the famous T-land.  Far less crowded than T-land and far more interesting to surf.',NULL,NULL,NULL),(29,'Padma Beach',-8.707832,115.156428,3.056,'Asia/Makassar','+0800',1,NULL,NULL,NULL,NULL,NULL),(30,'Kuta Reef',-8.735776,115.151377,3.056,'Asia/Makassar','+0800',1,NULL,NULL,NULL,NULL,NULL),(31,'Raijua Lefts',-10.621564,121.528957,NULL,'Asia/Makassar','+0800',1,18,'Reputedly the longest left in Indo on it\'s day.  It\'s certainly an awesome wave when it\'s on, extremely fast with no clear take off.  The wave breaks in beautiful clear water and even if you don\'t manage to surf it the sight is highly memorable.',NULL,NULL,NULL),(32,'Raptors',-9.95664,119.876216,NULL,'Asia/Makassar','+0800',1,1,'A-frame offering lots of barrel opportunity.  Sitting out at the end of a peninsula there is pretty much always swell and the water is crystal clear... It\'s more wind affected than spots in nearby bays so early morning is normally the best tie to surf this wave.',NULL,NULL,NULL),(33,'Magkudu Right',-10.330681,120.12986,NULL,'Asia/Makassar','+0800',1,3,'Sitting diametrically opposite Mangkudu Lefts, this wave can produce some excellent walls.  Needs a big south swell and zero-wind to work so is a rare treat when on.',NULL,NULL,NULL),(34,'Salurah',-10.304894,120.214051,NULL,'Asia/Makassar','+0800',1,3,'On it\'s day one of the best right-handers in the region producing long barrels followed by highly smackable walls.\n\nThis wave sits at the end of the beautiful, jurassic-like island of Salurah.  It needs a strong south swell and accommodating winds to work but when it\'s on it\'s a true gem.',NULL,NULL,NULL),(35,'Dirty Hippies',-8.676327,116.7693355,2.857,'Asia/Makassar','+0800',1,NULL,NULL,NULL,NULL,NULL),(36,'Donuts',-8.919696,116.739805,NULL,'Asia/Makassar','+0800',1,10,NULL,NULL,NULL,NULL),(37,'Lakey Peak',-8.805071,118.376009,3.392,'Asia/Makassar','+0800',1,NULL,'Perfect Lakey Peak peels off short, 30-40m lefts and rights into channels either side. The right will often throw up backdoor tube rides but gets too shallow at low tide, when the left is churning out predictable, ideal speed barrel rides. Mid tide lip-smacking sessions will appeal to intermediates and the flattish reef is user-friendly, except during full or new moon phases. Getting out to the Peak is easy with only a short 450m paddle or take the zodiac for around $2 return. Lakey Peak can hold juicy sized waves, but the optimum time to hit it is when it\'s in that perfect headhigh plus range.',NULL,NULL,NULL),(38,'Nungas',-8.793584,118.374689,3.392,'Asia/Makassar','+0800',1,NULL,'Nungas can peel off like a mini version of G-land, grooming 200m long lefts with alternating shack and whack sections to play with. Many surfers get diverted on the long walk to Periscopes, opting for long ride, short walk. Nungas bends into a big calm bay, needing more size than the Peak and not too much S in the afternoon trades.',NULL,NULL,NULL),(39,'Spot X',-8.857162,118.087043,NULL,'Asia/Makassar','+0800',1,38,'Long left hander offering a barrel section near take-off.  End section often being a wave in itself, punch wall.',NULL,NULL,NULL);
/*!40000 ALTER TABLE `sf_locations` ENABLE KEYS */;
UNLOCK TABLES;

